INSERT INTO `chart_of_accounts` VALUES (1,1,'Cash on Hand',1,1,2,'Cash on hand and demand deposits. Short-term, highly liquid investments that are readily convertible to known amounts of cash and that are subject to an insignificant risk of changes in value. ',1),(2,2,'Cash in Bank',1,1,2,'This account refers to money deposited in the bank under the name of the business, i.e. savings, current, time deposits, and combo-account. A subsidiary ledger shall be maintained for each bank account.',1),(3,3,'Petty Cash Fund',1,1,2,'This account refers to limited amount of money set aside for small expenditures such as stationeries, supplies and fares maintained under an imprest system. It should be replenished periodically when the fund gets low.',1),(4,4,'Accounts Receivable Trade-Current',1,1,2,'This account refers to the amount due from customer resulting from services rendered and sales of related goods /merchandise which are expected to be collected within the credit terms.',1),(5,5,'Accounts Receivable Trade-Past Due',1,1,2,NULL,1),(6,6,'Advances to Supplier',1,1,2,NULL,1),(7,7,'Advances to Officers and Employees',1,1,2,NULL,1),(8,8,'Inventories',1,1,2,'held for sale in the ordinary course of business',1),(9,9,'Input Tax',1,1,2,'This account refers to value-added tax due from or paid by a VAT registered/registrable entity on the importation or local purchases of merchandise/goods or services including lease or use of property.',1),(10,10,'Creditable VAT',1,1,2,'Refers to an amount that is withheld by the taxpayer\'s supplier arising from sale or procurement of goods/services from a taxable institution.',1),(11,11,'Creditable Withholding Tax',1,1,2,NULL,1),(12,12,'Unused Supplies',1,1,2,'This account refers to cost of supplies on hand.',1),(13,13,'Prepaid Expenses',1,1,2,'This account refers to payments made in advance, to be amortized within one (1) year (e.g. insurance, interest, rentals, etc.)\r\n',1),(14,14,'Other Current Assets',1,1,2,'A consumable item/product used regularly in an office environment to perform departmental personnel\'s daily work assignments.',1),(15,15,'Investment in Associates',1,2,2,NULL,1),(16,16,'Investment in Joint Ventures',1,2,2,NULL,1),(17,17,'Land',1,2,2,'This account refers to the acquisition cost of the land used for its main operation plus all incidental costs . All these are reflected in a single cost (fair market value or appraised value if donated). At the end of the accounting/ reporting period, fair value of the property must be disclosed.\r\n',1),(18,18,'Land Improvements',1,2,2,'This account refers to the cost of improvements after land acquisitions such as fencing, roadways, landscaping, etc, that are subject to depreciation over their useful lives.\r\n',1),(19,19,'Land Improvements - Accumulated Depreciation-Land Improvement',1,2,1,'This account refers to the total amount of depreciation/ impairment loss on land improvement that are set up periodically and charged against the current operations.',1),(20,20,'Building and Improvements',1,2,2,'This account refers to the acquisition/construction cost of the building and its improvement on the land owned and used for its main operation. Major repairs or improvements that will prolong the life of the building are considered capitalizable cost. At the end of the accounting/ reporting period, fair value of the property must be disclosed.',1),(21,21,'Building and Improvements - Accumulated DepreciationBuilding and Improvements',1,2,1,'This account refers to the acquisition/construction cost of the building and its improvement on the land owned and used for its main operation. Major repairs or improvements that will prolong the life of the building are considered capitalizable cost. At the end of the accounting/ reporting period, fair value of the property must be disclosed.',1),(22,22,'Building on Leased/Usufruct',1,2,2,NULL,1),(23,23,'Building on Leased/Usufruct - Accumulated Depreciation Building on Leased/Usufruct',1,2,1,NULL,1),(24,24,'Furniture, Fixtures & Equipment (FFE)',1,2,2,'This account refers to the cost of movable (furniture), immovable (fixtures) properties and office / production/ store equipment used in the ordinary course of business such as but not limited to desks, chairs, cabinets, computers, vaults, including incidental expenses incurred in acquiring them, up to the time they are received and ready for use.\r\n',1),(25,25,'Furniture, Fixtures & Equipment (FFE) - Accumulated Depreciation FFE',1,2,1,'This account refers to the cost of movable (furniture), immovable (fixtures) properties and office / production/ store equipment used in the ordinary course of business such as but not limited to desks, chairs, cabinets, computers, vaults, including incidental expenses incurred in acquiring them, up to the time they are received and ready for use.',1),(26,26,'Machineries, Tools and Equipment',1,2,2,'This account refers to the cost of machineries, tools and equipment owned and used in producing goods, providing services and repairs.',1),(27,27,'Machineries, Tools and Equipment - Accumulated Depreciation  Machineries, Tools and Equipment',1,2,1,'This account refers to the total amount of depreciation on machineries, tools and equipment that are set-up periodically and charged against the current operations',1),(28,28,'Transportation Equipment',1,2,2,'This account refers to the cost of equipment owned and used in transporting goods, services or personnel such as motorcycles, pick-ups, vans and other vehicles.\r\n',1),(29,29,'Transportation Equipment - Accumulated Depreciation  Transportation Equipment',1,2,1,'This account refers to the total amount of depreciation/ impairment cost on Transportation Equipment that are set up periodically and charged against current operations\r\n',1),(30,30,'Other Property, Plant and Equipment',1,2,2,NULL,1),(31,31,'Trade and Other Payables',1,3,1,NULL,1),(32,32,'Accounts Payable-Trade',1,3,1,'This account refers to obligations/indebtedness to suppliers for purchase of goods and services intended for sale\r\n',1),(33,33,'Accrued Expenses',1,3,1,'This account refers to other accrued expenses that cannot be classified under any of the preceding accrued expenses accounts.\r\n',1),(34,34,'Loans Payable  Current',1,3,1,'This account refers to the indebtedness to financial institutions or individuals payable within the accounting/fiscal period and the current portion of the Long Term Loans Payable.\r\n\r\n\r\n',1),(35,35,'Due to Gov\'t Agencies - SSS payables',1,3,1,'This account refers to amounts withheld from the compensation income of employees representing their premium contributions to SSS, Philhealth and Pag-ibig agencies and the corresponding share of the employer.\r\n',1),(36,36,'Due to Gov\'t Agencies - PHIC payables',1,3,1,'This account refers to amounts withheld from the compensation income of employees representing their premium contributions to SSS, Philhealth and Pag-ibig agencies and the corresponding share of the employer.\r\n\r\n',1),(37,37,'Due to Gov\'t Agencies - Pag-ibig payables',1,3,1,'This account refers to amounts withheld from the compensation income of employees representing their premium contributions to SSS, Philhealth and Pag-ibig agencies and the corresponding share of the employer.',1),(38,38,'Due to Bureau of Internal Revenue - Withholding Tax Payable',1,3,1,'This account refers to all taxes withheld as prescribed by law.\r\n',1),(39,39,'Due to Bureau of Internal Revenue - Output Tax',1,3,1,'This account refers to value added tax on the sale of taxable merchandise/ goods and services.\r\n',1),(40,40,'Due to Bureau of Internal Revenue - VAT Payable',1,3,1,'This account refers to excess of output tax over input tax.\r\n',1),(41,41,'Due to Bureau of Internal Revenue - Income Tax Payable',1,3,1,'This refers to amount of unpaid tax due arising from taxable income.\r\n',1),(42,42,'Other Current Liabilities',1,3,1,NULL,1),(43,43,'Loans Payable-Long Term',1,4,1,'This account refers to the indebtedness to financial institutions, unions, or individuals payable beyond one year.\r\n',1),(44,44,'Retirement Payable',1,4,1,NULL,1),(45,45,'Other Non-Current Liabilities',1,4,1,'The totality of all other liabilities that cannot be classified after any of the preceding liability accounts.\r\n',1),(46,46,'Owner\'s Equity',1,5,1,'Owners equity is essentially the owners rights to the assets of the business.\r\n',1),(47,47,'Additional Investments',1,5,1,'Additional Investments means investments in, or cash proceeds received by, Borrowers in the form of loans, equity (including, without limitation, net cash proceeds from capital contributions), or net cash proceeds from non-recurring cash income which was not received ...',1),(48,48,'Net Income',1,5,1,NULL,1),(49,49,'Net Loss',1,5,2,NULL,1),(50,50,'Withdrawals',1,5,2,'Also referred to as draws. These are a reduction of owner\'s equity, but are not a business expense and they donotappear on the sole proprietorship\'s income statement.\r\n',1),(51,51,'Revenue-Trucking',2,6,1,'Revenue isthe total amount of income generated by the sale of goods or services related to the company\'s primary operations.\r\n',1),(52,52,'Sales',2,6,1,'Sales refers to the volume of goods and services sold by a business during a reporting period. When quantified into a monetary amount, it is positioned at the top of the income statement, after which operating and other expenses are subtracted to arrive at a profit or loss figure.\r\n',1),(53,53,'Cost of Goods Sold',2,7,2,'The cost/value of commodity sold as determined using physical or perpetual inventory system.',1),(54,54,'Inventory Loss',2,7,2,'This account refers to reduction in inventory due to spoilage, breakage and variance between inventory per books and per count\r\n',1),(55,55,'Cost of Transport Services - Salaries & Wages-Operation',2,8,2,'This account refers to amount incurred for services rendered by employees directly involved in providing services including overtime pay',1),(56,56,'Cost of Transport Services - Repairs and Maintenance-Transport Equipments',2,8,2,'This account refers to expenses incurred in the repair and maintenance of transport facility and equipment except major repairs that prolong the life of the asset.',1),(57,57,'Cost of Transport Services - Gas, Oil & Lubricants-Transport Equipments',2,8,2,'This account refers to amounts incurred for gasoline, fuel and lubricants for vehicles and for day to day operation.',1),(58,58,'Salaries & Wages-Management',2,8,2,'This account refers to tear of building, machineries and equipment used in the delivery of service.',1),(59,59,'Employees Benefits',2,9,2,'The total remuneration, in cash or in kind, payable to all persons counted on the payroll (including homeworkers), in return for work done during the accounting period\" regardless of whether it is paid on the basis of working time, output or piecework and whether it is paid regularly or not.',1),(60,60,'SSS, Philhealth, Pag-Ibig Contribution',2,9,2,'These are recognised when the employee has rendered the service and are measured at the undiscounted amount of benefits expected to be paid in exchange for that service.',1),(61,61,'Professional and Consultancy Fees',2,9,2,NULL,1),(62,62,'Professional and Consultancy Fees',2,9,2,'Professional fees are recorded asan expenditure in the books of corporations. Business corporations frequently seek expert help, resulting in such fees. The rate is determined well in advance of the service being rendered, and the fees may be assessed hourly and vary from person to person.\r\n',1),(63,63,'Supplies',2,9,2,NULL,1),(64,64,'Communication, Power, Light and Water',2,9,2,'Is the cost incurred by using utilities such as electricity, water, waste disposal, heating, and sewage. The expenses are incurred over the course of the reporting period, calculated, and accrued for, or payment is rendered.\r\n',1),(65,65,'Insurance',2,9,2,'Insurance isa contractual agreement under which the insured party promises to pay the insurer a periodic amount in exchange for a payout in the event of a future loss.\r\n',1),(66,66,'Repairs and Maintenance-Others',2,9,2,NULL,1),(67,67,'Rentals',2,9,2,'Isa type of fixed operating cost or an absorption cost for a business, as opposed to a variable expense.\r\n',1),(68,68,'Gas, Oil & Lubricants-Others',2,9,2,NULL,1),(69,69,'Miscellaneous',2,9,2,'Aresmall transactions that do not fit within the ledgers\' specified accounts. Miscellaneous expenses, meaning costs that don\'t fall into a specific tax category, must be recorded and accounted for in your business\'s general ledger account.\r\n',1),(70,70,'Depreciation-Others',2,9,2,NULL,1),(71,71,'Representation',2,9,2,'Arethose expenditures whose character and primary purpose is for representational or entertainment related activities, including receptions or banquets.\r\n',1),(72,72,'Taxes and License',2,9,2,'All state, local, and foreign taxespaid or accruedin connection with trade or business or production of income are deductible. In addition, annual fees paid to keep a business license current are deductible as an ordinary and necessary business expense\r\n',1),(73,73,'Interest Expense on Borrowings',2,10,2,NULL,1),(74,74,'Bank Charges',2,10,2,NULL,1),(75,75,'Other Income',2,11,1,NULL,1),(76,76,'Gain on Sales',2,11,1,NULL,1),(77,77,'Loss on Sales',2,11,2,NULL,1),(78,78,'Income/ Interest from Investment/ Deposits',2,11,1,NULL,1),(79,79,'Commission Income',2,11,1,NULL,1),(80,80,'Miscellaneous Income',2,11,1,NULL,1),(81,81,'Salaries & Wages-Plat Man',2,9,2,NULL,1),(82,82,'Donation',2,9,2,NULL,1);
